import React from 'react';
import { useLoaderData } from 'react-router-dom';
import Rechart from '../Rechart/Rechart';


const StatChart = () => {
    const topics = useLoaderData();
    const { data } = topics;
    console.log(data);

    return (
        <div>
            {
                data.map(tq => <Rechart
                    key={tq.id}
                    tq={tq}
                ></Rechart>)
            }
        </div>
    );
};

export default StatChart;
